import React from 'react'
import classes from './MyForm.css'
import Button from '../UI/Button/Button'
import {connect} from 'react-redux'

const MyForm = (props)=>{
    console.log()
    return(
        <div className={classes.MyForm}>


            <label htmlFor="TaskName">Task Name: </label>
            <input type="text" onChange={(e)=>props.onChange(e)}/>

            <label htmlFor="TaskName">End Date: </label>
            <input type="text" id='endDate'/>

            <label htmlFor="TaskName">Description: </label>
            <input type="text" id='description'/>
            <Button onClick={props.AddTask} type={'green'}>Add Task</Button>
        </div>
    )

};

function mapStateToProps(state) {
    return{
        tasks: state
    }

}
export default connect(mapStateToProps)(MyForm);
